import React from 'react';
import ReactModal from 'react-modal';
import { useState, useEffect } from 'react';

const Footer = () => {

    const [isModalOpen, setIsModalOpen] = useState(false);

    const openModal = () => {
        setIsModalOpen(true);
        console.log('ok')
    };

    const closeModal = () => {
        setIsModalOpen(false);
    };

    useEffect(() => {
        ReactModal.setAppElement('body');
    }, []);

    return (
        <div className="Footer">
            <div className="horaireGarage">
                <li>Lundi : 08h45 - 12h00, 14h00 - 18h00</li>
                <li>Mardi : 08h45 - 12h00, 14h00 - 18h00</li>
                <li>Mercredi : 08h45 - 12h00, 14h00 - 18h00</li>
                <li>Jeudi: 08h45 - 12h00, 14h00 - 18h00</li>
                <li>Vendredi : 08h45 - 12h00, 14h00 - 18h00</li>
                <li>Samedi : 08h45 - 12h00</li>
                <li>Dimanche : Fermé</li>
            </div>
            <ReactModal
                isOpen={isModalOpen}
                onRequestClose={closeModal}
            >


            </ReactModal>
        </div>
    );
};

export default Footer;
